"<p style=\" margin-top:0px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'Times New Roman\',\'serif\'; font-size:12pt;\">4</span><span style=\" font-family:\'宋体\'; font-size:12pt;\">）氨基酸评分（</span><span style=\" font-family:\'Times New Roman\',\'serif\'; font-size:12pt;\">AAS</span><span style=\" font-family:\'宋体\'; font-size:12pt;\">）</span> </p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'宋体\'; font-size:12pt;\">氨基酸是组成蛋白质的基本单位，人体内的必需氨基酸有八种，分别是</span><span style=\" font-family:\'宋体\'; font-size:12pt; font-weight:600;\">异亮氨酸、亮氨酸、赖氨酸、含硫氨基酸、芳香族氨基酸、苏氨酸、色氨酸、缬氨酸</span><span style=\" font-family:\'宋体\'; font-size:12pt;\">。当食物中蛋白质的氨基酸数量和组成符合人体需要时，其吸收利用率比较高。</span> </p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'宋体\'; font-size:12pt; font-weight:600;\">氨基酸评分（</span><span style=\" font-family:\'Times New Roman\',\'serif\'; font-size:12pt; font-weight:600;\">AAS</span><span style=\" font-family:\'宋体\'; font-size:12pt; font-weight:600;\">）</span><span style=\" font-family:\'宋体\'; font-size:12pt;\">也称为蛋白质化学评分，是用被测食物蛋白质的必需氨基酸与参考蛋白质的氨基酸模式进行比较，计算出比值，比值最低者为</span><span style=\" font-family:\'宋体\'; font-size:12pt; font-weight:600;\">第一限制氨基酸</span><span style=\" font-family:\'宋体\'; font-size:12pt;\">。由于限制氨基酸的存在，使食物蛋白质的利用受到限制，所以第一限制氨基酸的评分值即为该食物蛋白质的氨基酸评分。目前氨基酸评分法是广为应用的一种食物蛋白质营养价值评价方法，不仅适用于单一食物蛋白质的评价，还可用于混合食物蛋白质的评价。</span> </p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'宋体\'; font-size:12pt;\">针对不同食物蛋白质的营养特点，将两种或两种以上食物蛋白质混合食用，其中所含的必需氨基酸取长补短，相互补充，达到较好的比例，这种效果称为</span><span style=\" font-family:\'宋体\'; font-size:12pt; font-weight:600;\">蛋白质的互补作用</span><span style=\" font-family:\'宋体\'; font-size:12pt;\">。</span></p>\n"
"<p style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'宋体\'; font-size:12pt;\">参考蛋白质氨基酸评分模式见表</span><span style=\" font-family:\'Times New Roman\',\'serif\'; font-size:12pt;\">3</span><span style=\" font-family:\'宋体\'; font-size:12pt;\">。</span> </p>\n"
"<p align=\"center\" style=\" margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;\"><span style=\" font-family:\'宋体\';\">表</span><span style=\" font-family:\'Times New Roman\',\'serif\';\">3  </span><span style=\" font-family:\'宋体\';\">参考蛋白质氨基酸评分模式</span> </p>\n"
